"Инженер приходит, всё привозит, подключает, настраивает и уезжает. Чтобы всё так и прошло, дома должен быть владелец договора с дом.ру или его представитель старше 18 лет. 

Представителю нужна доверенность, которую можно написать от руки. Главное — вписать: 
– ФИО клиента и его представителя; 
– паспортные данные клиента; 
– адрес клиента; 
– дату подписания доверенности; 
– подтверждение, что клиент передает представителю право представлять его перед третьими лицами. 

Также понадобится паспорт представителя и копия паспорта владельца договора."

